import React, { useState, useEffect } from 'react';
import axios from 'axios';


const Users = () => {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        axios.get('/List')
            .then(response => {
                setUsers(response.data);
            });
    }, []);

    return (
        <>
            <h1>Users</h1>
            <UserList users={users}/>
        </>
    );
}
